
inputVar = ""

def dnaSequence(s):
    sequences = []
    setSequences = {}
    for i in range(len(s)-9):
        sub = s[i:i+10]
        if sub in setSequences:
            setSequences[sub] += 1
        else:
            setSequences[sub] = 1
    
    for i in setSequences:
        if setSequences[i] > 1:
            sequences.append(i)
    return sequences

print (dnaSequence(inputVar))
